Object? _splitCommaSeparated(Object? value) {
  if (value is String && value.contains(',')) {
    final parts = value
        .split(',')
        .map((entry) => entry.trim())
        .where((entry) => entry.isNotEmpty)
        .toList();
    if (parts.isNotEmpty) {
      return parts;
    }
  }
  return value;
}

String _normalizeTypeKey(Object? value) {
  if (value == null) {
    return '';
  }
  return value.toString().trim().toLowerCase().replaceAll(
    RegExp(r'[^a-z0-9]'),
    '',
  );
}

bool _matchesConstructorKeys(
  Map<String, Object?> map,
  List<String> allowed,
  List<String> required,
) {
  for (final entry in map.keys) {
    if (!allowed.contains(entry)) {
      return false;
    }
  }
  for (final entry in required) {
    if (!map.containsKey(entry)) {
      return false;
    }
  }
  return true;
}

int? _normalizeColorInt(int? value) {
  if (value == null) {
    return null;
  }
  if (value >= 0 && value <= 0xFFFFFF) {
    return 0xFF000000 | value;
  }
  return value;
}
